// frontend/src/App.js
import React, { useState } from 'react';
import Login from './components/Login';
import Chat from './components/Chat';

const App = () => {
    const [token, setToken] = useState(null);

    if (!token) {
        return <Login setToken={setToken} />;
    }

    return <Chat token={token} />;
};

export default App;
